import React from 'react';
import {
    Button,
    Card,
    CardHeader,
    CardBody,
    CardTitle,
    Table,
    Col,
} from "reactstrap";

export const ListVecinoFila = ({ vecino }) => {
    return (
        <tr>
            <td>vecino.id_veci</td>
            <td className="text-center">
                <Button className="btn-fill" color="success" type="submit">
                    Confirmar
                </Button>
            </td>
        </tr>
    )
}
